function this.Reload()
	this.playerCamoufTable = {}
	this.playerCamoufTable = this.GetCamoTable()		
	if ZetaIndex ~= nil then --Load mods
		local newCamoParameters = ZetaIndex.ModGet("PlayerCamoParameters", this)
		if newCamoParameters ~= nil and next(newCamoParameters) then this.playerCamoufTable = ZetaUtil.MergeTables(this.playerCamoufTable, newCamoParameters) end
	end
	Player.InitCamoufTable(this.playerCamoufTable)
end
return this
